import React from 'react';
import { Link } from 'react-router-dom';
import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  const handleLogout = () => {
    navigate("/"); // Redirect to the first page
  };
  return (
    <div>
      <nav className="navbar">
        <div className="navbar-left">
          <button className="navbar-button">Cart</button>
          <button onClick={handleLogout}className="navbar-button">Logout</button>
        </div>
        <div className="navbar-right">
          <span className="navbar-brand">Litverse</span>
        </div>
      </nav>
      
      <div className="home-content">
        <h1>Welcome to Your Dashboard!</h1>
        <p>This is your home page after logging in.</p>
        {/* Add more components or content you'd like to display */}
      </div>
    </div>
  );
};

export default Home;
